    str += tmpStr;
    snprintf(tmpStr, 1000, "%stri_lower = %g\n", prefix, atts->GetTri_lower());
    str += tmpStr;
    snprintf(tmpStr, 1000, "%stri_upper = %g\n", prefix, atts->GetTri_upper());
    str += tmpStr;
    if(atts->GetQuad())
        snprintf(tmpStr, 1000, "%sQuad = 1\n", prefix);
